import React from "react";

const BookmarkIcon = ({ clicked }) => {
  const dynamicClassName = () => {
    console.log(clicked);
    if (clicked) return "fas";
    else return "far";
  };
  return (
    <span style={{ fontSize: 3 + "em", color: "Tomato" }}>
      <i className={`${dynamicClassName()} fa-bookmark`}></i>
    </span>
  );
};

export default BookmarkIcon;
